import React, { useState } from "react";
import "./Query.css"; // Your CSS file for styling

const Query = () => {
  const [formData, setFormData] = useState({
    // ... (unchanged)
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // For demonstration, log the form data
    // Perform form submission logic here
  };

  return (
    <div className="form-container">
      <form className="form" onSubmit={handleSubmit}>
        <div className="form-grid">
          <div className="form-group">
            <label htmlFor="name">Name:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
            />
            <label htmlFor="name">Designation:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.designation}
              onChange={handleChange}
            />
            <label htmlFor="name">Organization:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.organization}
              onChange={handleChange}
            />
            <label htmlFor="name">Office Address:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.officeAddress}
              onChange={handleChange}
            />
            <label htmlFor="name">City:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.city}
              onChange={handleChange}
            />
            <label htmlFor="name">Email Address:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.emailAddress}
              onChange={handleChange}
            />
            <label htmlFor="name">Telephone no.:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.telephoneNo}
              onChange={handleChange}
            />
            <label htmlFor="name">Mobile Number:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.mobileNumber}
              onChange={handleChange}
            />
          </div>

          {/* Other form fields go here */}
          {/* Repeat the structure for other form fields as needed */}

          <div className="form-group">
            <label htmlFor="professionalUpdates">
              Other Professional Updates:
            </label>
            <div className="radio-buttons">
              {/* Radio buttons for professional updates */}
            </div>
          </div>

          {/* Dropdown for subject of query */}
          {/* Text area for query */}
        </div>
      </form>

      <button type="submit">Submit</button>
    </div>
  );
};

export default Query;
